import React, { Component } from 'react';

class NoteList extends Component {
  render(){
    notes = [];
    let i = 0;
    for (i = 0; i < localStorage.length; i++){
      notes.append(localStorage[i])
    }
    return(
      <div className="row row-100">
        {notes}
      </div>
    )
  }
}

export default NoteList;
